let poll = setInterval(() => {
    let logo = document.getElementById("logo");
    if (logo === null) {
        return;
    }

    let ytdLogo = logo.getElementsByTagName("ytd-logo");
    if (ytdLogo === null) {
        return;
    }

    for (let i = 0; i < ytdLogo.length; i++) {
        if (ytdLogo[i].classList.contains("ytd-topbar-logo-renderer")) {
            let overlay = document.createElement("img");
            overlay.src = "data:image/png;base64,";
            overlay.style = "position: absolute; width: 100px; left: 65px; top: -10px;";
            ytdLogo[i].appendChild(overlay);
            clearInterval(poll);
        }
    }
}, 1000);
